import React from "react";
import {useEffect} from "react";
import { useSelector } from "react-redux";
import { useDispatch } from "react-redux";
import {getDogs} from "../../redux/actions/actions"
import { Link } from "react-router-dom";
import Card from '../CARD/Card'



 function Home() {
    const dispatch = useDispatch()
    const dogs= useSelector((state)=>state.dogs)

    useEffect(()=>{
        dispatch(getDogs())
    },[])


    function handleClick(event){
    event.preventDefault()
    dispatch(getDogs())
    }


    return (
        <div>
           <Link to='/dogs'>Create Breed</Link> 
           <h1>We Love Dogs</h1>
           <button onClick={event => {handleClick(event)}}>
           Show me all the dog breeds again!
           </button>
           <div>
             <select>
                <option value= "asc">Ascending</option> 
                <option value= "desc">Descending</option>
             </select>
             <select>
                <option value= "temps">Temperaments</option>
                <option value= "ori">Origin</option> 
             </select>   
             <select>
                <option value= "all">Temperaments</option>
                <option value= "created">Origin</option> 
             </select>   
   
             {
               dogs && dogs.map(el =>{
                  return(
                     <Card name={el.name} temperaments={el.temperaments} weight={el.weight} image={el.image}/>
                  )                 
               })
             }
           </div>
        </div>
    )
}
export default Home;
